import React from 'react'
import MessagesBox from './components/MessagesBox.jsx';

function App() {
    const [messages, setMessages] = React.useState();
    React.useEffect(() => {
        fetch("http://127.0.0.1:8000/acess/treinamento_final31.jsonl/0")
        .then(response => response.json())
        .then(data => {
            setMessages(data)
        })
        .catch(err => console.log(err))
    }, [])

    // const messagesComponents = messages.map(message => {
    //     return <MessagesBox text={message.content} role={message.role} />
    // })

    return(
       {messages}
    )
}

export default App;
